  namespace: VDS.RDF
  summary: "\nA Thread Safe version of the <xref href=\"VDS.RDF.Graph\" data-throw-if-not-resolved=\"false\"></xref> class.\n"
  remarks: "\n<p>\nPerformance will be marginally worse than a normal <xref href=\"VDS.RDF.Graph\" data-throw-if-not-resolved=\"false\"></xref> but in multi-threaded scenarios this will likely be offset by the benefits of multi-threading.\n</p>\n<p>\nSince this is a non-indexed version load performance will be better but query performance better.\n</p>\n"
